		public static IEnumerable<InterfaceTwinsInfo> GetInterfaceModelsData()
		{
			IEnumerable<DTEntityInfo> interfaceModels;
			var parser = new ModelParser();
			var allModels = GetModelsData();
			interfaceModels = allModels.Select(dep => dep.Value).Where(m => m.EntityKind == DTEntityKind.Interface);

			var interfaceTwinsInfos = new List<InterfaceTwinsInfo>();
			foreach (var model in interfaceModels)
			{
				var modelId = model.Id.AbsoluteUri;
				interfaceTwinsInfos.Add(new InterfaceTwinsInfo()
                {
                    Id = model.Id.AbsoluteUri,
                    TotalCount = 2,
                    ExactCount = 1,
                    Description = "Test Interface",
                    UploadTime = DateTimeOffset.Now
                });
			}

			return interfaceTwinsInfos;
		}

